import React from 'react'
import './SearchBar.css'


const SearchBar = props => {
    return (
        <div className="search">
            <div>
                <input type="text" value={props.filterText} placeholder="Rechercher" onChange={(e) => props.onChangefilterText(e.target.value)}/>
            </div>
            <div>
                <input type="checkbox" id="stock" checked={props.inStockOnly} onChange={(e) => props.onChangeStockOnly(e.target.checked)}/>
                <label htmlFor="stock">Produit en stock</label>
            </div>
        </div>
    )
}

export default SearchBar;
